window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"22.0.0","implementation":{"version":"9.6.0","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.22621"},"runtime":{"name":"node.js","version":"18.18.2"}}},{"source":{"data":"Feature: Balances Page\r\n\r\n As a user \r\n I want to test\r\n Polkadex Balances Page\r\n\r\nBackground:\r\n Given I am on the home screen\r\n And I click on Start Trading button\r\n And I can see DOT/USTD Text on screen\r\n\r\n\r\nScenario: Verify Import Button functionality and Balance Page functionalities\r\nAnd I click on login link\r\nAnd I enter the email as \"hjose@4labsinc.com\"\r\nAnd I enter the password as \"Leena@2010\"\r\nWhen I click on the login button\r\nThen Login should be success\r\nThen I click cross button on popup\r\nWhen I clicked on Wallets link on Polkadex page\r\nThen I can see What is a Funding Account? popup\r\nAnd I click on Next button on What is Funding Account? popup\r\nAnd I can see What is a Trading Account? popup\r\nAnd I click on Done button on What is Trading Account? popup  \r\nThen I can see heading as Wallets on Wallets page\r\nWhen I clicked on Import Account button\r\nThen I can see add trading account window\r\nWhen I click on the Import existing trading account window\r\nThen I can see Json file Radio button\r\nWhen I click on Json file Radio button \r\nThen I can see upload file button\r\nWhen I clicked on upload file button\r\nThen I can see Import Button got enabled under add trading account window\r\nAnd I click on the Import Button under add trading account window\r\nThen Trading Account imported successfully\r\nThen I click on back button under add trading account window\r\nWhen I click on Balances link on Polkadex page\r\nThen I can see What is Deposit? popup\r\nThen I click on Next button on What is Deposit? popup\r\nThen I can see What is Withdrawal? popup\r\nThen I click on Next button on What is Withdrawal? popup\r\nThen I can see What is Transfer? popup\r\nThen I click on Done button on What is transfer? popup  \r\nThen I see text as \"Available balance in your funding and trading account. on balance page\"\r\nThen I can get the list of cloumn header names under Overview Section \r\nThen I click on the Name Cloumn header\r\nThen I click on the Funding Account Cloumn header\r\nThen I click on the Trading Account Cloumn header\r\nThen I click on the In Orders Cloumn header\r\nThen I click Hide small balances checkbox\r\nWhen I searched text \"DOT\" in search bar of overview Section\r\nThen searched item should display under overview Section\r\nThen I can see \"Contact us\" Button on Balances Page\r\nAnd I can see Text as \"Having Trouble?\" on footer part\r\nAnd I can see Text as \"Feel free to get in touch.\" on footer part\r\nThen I can see the \"Open tour\" Button on Balances Page\r\nAnd I can see Text as \"Deposit, Withdrawal, and Transfer differences\" on footer part\r\nAnd I can see Text as \"We'll guide you through these new processes on a quick tour.\" on footer part\r\nThen I can see \"Deposit\" Button on Balances Page\r\nThen I can see \"Transfer\" Button on Balances Page","uri":"features\\balancesSmokeTest.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Balances Page","description":" As a user \n I want to test\n Polkadex Balances Page","children":[{"background":{"id":"faaa23fc-ab43-40bc-b339-2acd5e338916","location":{"line":7,"column":1},"keyword":"Background","name":"","description":"","steps":[{"id":"20cb4697-8374-414e-9a7f-40c725eb03b0","location":{"line":8,"column":2},"keyword":"Given ","keywordType":"Context","text":"I am on the home screen"},{"id":"f91ddfbc-4afc-4649-876b-d0e3c4104318","location":{"line":9,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"I click on Start Trading button"},{"id":"3fa3e0d3-dfec-418a-a21c-70388647c02f","location":{"line":10,"column": ding or funding account\r\nAnd I click on login link\r\nAnd I enter the email as \"hjose@4labsinc.com\"\r\nAnd I enter the password as \"Leena@2010\"\r\nWhen I click on the login button\r\nThen Login should be success\r\nThen I click cross button on popup\r\nWhen I clicked on Wallets link on Polkadex page\r\nThen I can see What is a Funding Account? popup\r\nAnd I click on Next button on What is Funding Account? popup\r\nAnd I can see What is a Trading Account? popup\r\nAnd I click on Done button on What is Trading Account? popup  \r\nThen I can see heading as Wallets on Wallets page\r\nWhen I clicked on Import Account button\r\nThen I can see add trading account window\r\nWhen I click on the Import existing trading account window\r\nThen I can see Json file Radio button\r\nWhen I click on Json file Radio button \r\nThen I can see upload file button\r\nWhen I clicked on upload file button\r\nThen I can see Import Button got enabled under add trading account window\r\nAnd I click on the Import Button under add trading account window\r\nThen Trading Account imported successfully\r\nThen I click on back button under add trading account window\r\nWhen I click on Balances link on Polkadex page\r\nThen I can see What is Deposit? popup\r\nThen I click on Next button on What is Deposit? popup\r\nThen I can see What is Withdrawal? popup\r\nThen I click on Next button on What is Withdrawal? popup\r\nThen I can see What is Transfer? popup\r\nThen I click on Done button on What is transfer? popup  \r\nThen I see text as \"Available balance in your funding and trading account. on balance page\"\r\nThen I can get the list of cloumn header names under Overview Section \r\nThen I click on the Name Cloumn header\r\nThen I click Hide small balances checkbox\r\nWhen I searched text \"DOT\" in search bar of overview Section\r\nThen searched item should display under overview Section\r\n","uri":"features\\QSTB-T1_Verify_UI_and_design_With_trading_or_funding_account.feature","mediaType": n see upload file button\r\nWhen I clicked on upload file button\r\nThen I can see Import Button got enabled under add trading account window\r\nAnd I click on the Import Button under add trading account window\r\nThen Trading Account imported successfully\r\nThen I click on back button under add trading account window\r\nWhen I click on Balances link on Polkadex page\r\nThen I can see What is Deposit? popup\r\nThen I click on Next button on What is Deposit? popup\r\nThen I can see What is Withdrawal? popup\r\nThen I click on Next button on What is Withdrawal? popup\r\nThen I can see What is Transfer? popup\r\nThen I click on Done button on What is transfer? popup  \r\nThen I am able to view \"Actions\" Header Text on balances Page\r\nThen I can see \"Withdraw\" Button on Balances Page\r\nWhen I click on Withdraw button on Balances Page\r\nThen balance page is navigated to 'https://thea.polkadex.trade/withdraw' page\r\nThen I can see \"Withdraw\" Button on Balances Page\r\n","uri":"features\\QSTB-T34_Verify_the_Withdraw_button_Click.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Balances Page","description":" As a user \n I want to test\n Polkadex Balances Page Withdraw_button_Click","children":[{"background":{"id":"a2c1264e-3c5c-49a6-9081-5ee1b9f47fb5","location":{"line":7,"column":1},"keyword":"Background","name":"","description":"","steps":[{"id":"d6ce83c8-6051-4049-b9a2-4d3ce5577b18","location":{"line":8,"column":2},"keyword":"Given ","keywordType":"Context","text":"I am on the home screen"},{"id":"20bfb7b4-cedf-41a8-853b-df77ed6484b4","location":{"line":9,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"I click on Start Trading button"},{"id":"d46423de-b5a4-488b-b44b-f7375dc2d226","location":{"line":10,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"I can see DOT/USTD Text on screen"}]}},{"scenario":{"id"  upload file button\r\nThen I can see Import Button got enabled under add trading account window\r\nAnd I click on the Import Button under add trading account window\r\nThen Trading Account imported successfully\r\nThen I click on back button under add trading account window\r\nWhen I click on Balances link on Polkadex page\r\nThen I can see What is Deposit? popup\r\nThen I click on Next button on What is Deposit? popup\r\nThen I can see What is Withdrawal? popup\r\nThen I click on Next button on What is Withdrawal? popup\r\nThen I can see What is Transfer? popup\r\nThen I click on Done button on What is transfer? popup  \r\nThen I am able to view \"Actions\" Header Text on balances Page\r\nThen I can see \"Transfer\" Button on Balances Page\r\nWhen I click on Transfer button on Balances Page\r\nThen balance page for Transfer button is navigated to \"https://orderbook.polkadex.trade/transfer?token=USDT\" page\r\n","uri":"features\\QSTB-T36_Verify_the_Transfer_button_Click.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Balances Page Transfer Button verification","description":" As a user \n I want to test\n Polkadex Balances Page Transfer_button_Click","children":[{"background":{"id":"a8489efc-6995-41c7-9f89-d57edd354205","location":{"line":7,"column":1},"keyword":"Background","name":"","description":"","steps":[{"id":"28d05027-d461-49a5-8368-a33f3dd0601f","location":{"line":8,"column":2},"keyword":"Given ","keywordType":"Context","text":"I am on the home screen"},{"id":"82004c13-beb3-4cfd-bba9-a2fca4102acb","location":{"line":9,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"I click on Start Trading button"},{"id":"6d1f6283-9515-4e8b-8bd7-5365d2fcd11f","location":{"line":10,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"I can see DOT/USTD Text on screen"}]}},{"scenario":{"id":"4916afc6-53e8-4bc0-8a23-1b9cc30 er add trading account window\r\nAnd I click on the Import Button under add trading account window\r\nThen Trading Account imported successfully\r\nThen I click on back button under add trading account window\r\nWhen I click on Balances link on Polkadex page\r\nThen I can see What is Deposit? popup\r\nThen I click on Next button on What is Deposit? popup\r\nThen I can see What is Withdrawal? popup\r\nThen I click on Next button on What is Withdrawal? popup\r\nThen I can see What is Transfer? popup\r\nThen I click on Done button on What is transfer? popup  \r\nThen I am able to view \"Actions\" Header Text on balances Page\r\nThen I can see \"Transfer\" Button on Balances Page\r\nWhen I click on Transfer button on Balances Page\r\nThen balance page for Transfer button is navigated to \"https://orderbook.polkadex.trade/transfer?token=ASTR\" page\r\nThen I can see Text as \"Transfer\" on Transfer page\r\nThen I can see Text as \"Move tokens between your Funding account and Trading account\" on Transfer page\r\nThen I can see Text as \"Transfer to other Polkadex accounts\" on Transfer page\r\nThen I can see \"radio button\" with Transfer to other Polkadex accounts Text\r\nThen I click on \"Radio button\" of Transfer to other Polkadex accounts","uri":"features\\QSTB-T38_Verify_Transfer_UI.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"TransferPage_Verify the Transfer_UI","description":" As a user \n I want to test\n Polkadex Transfer look and feel","children":[{"background":{"id":"fa88a7d2-8f34-43b9-ac31-49b2120297ab","location":{"line":7,"column":1},"keyword":"Background","name":"","description":"","steps":[{"id":"94c2d42a-b92b-4ad7-88fb-63db98fae67d","location":{"line":8,"column":2},"keyword":"Given ","keywordType":"Context","text":"I am on the home screen"},{"id":"239d7ac9-2aa8-4ba0-aec3-8bad77fb26c2","location":{"line":9,"column":2},"keyword": en I click on Next button on What is Withdrawal? popup\r\nThen I can see What is Transfer? popup\r\nThen I click on Done button on What is transfer? popup  \r\nThen I am able to view \"Actions\" Header Text on balances Page\r\nThen I can see \"Transfer\" Button on Balances Page\r\nWhen I click on Transfer button on Balances Page\r\nThen balance page for Transfer button is navigated to \"https://orderbook.polkadex.trade/transfer?token=ASTR\" page\r\nThen I can see Text as \"Transfer\" on Transfer page\r\nThen I can see Text as \"Move tokens between your Funding account and Trading account\" on Transfer page\r\nThen I can see Text as \"Transfer to other Polkadex accounts\" on Transfer page\r\nThen I can see \"radio button\" with Transfer to other Polkadex accounts Text\r\nThen I click on \"Radio button\" of Transfer to other Polkadex accounts","uri":"features\\QSTB-T40_Verify_Transfer_Transfer_to_other_Polkadex_accounts_radio_button.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Transfer to other Polkadex accounts radio button verification","description":" As a user \n I want to test\n Polkadex Transfer to other Polkadex accounts radio button","children":[{"background":{"id":"7804eda4-2279-46c7-bebf-ccda3cb55856","location":{"line":7,"column":1},"keyword":"Background","name":"","description":"","steps":[{"id":"387ba302-9354-4e77-bd72-70a4c11c8a11","location":{"line":8,"column":2},"keyword":"Given ","keywordType":"Context","text":"I am on the home screen"},{"id":"9e3fbded-b9b9-40b9-8ee9-4c6ea0df2070","location":{"line":9,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"I click on Start Trading button"},{"id":"24915b65-bd39-47dd-99e8-38c023fae5a5","location":{"line":10,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"I can see DOT/USTD Text on screen"}]}},{"scenario":{"id":"2b1d9656-e540-4221-aad7-604638e0805a","ta
